  false,\n\t\"url\": null,\n\t\"notes\": \"Meteorological data were collected using
  meteorological sensors from the USS JOHN PAUL JONES in the Northeast Pacific Ocean.
  Data were collected and recorded into the observations log sheets from 12 April
  2004 to 23 April 2004. Data were collected and submitted by the US Navy; Ships of
  Opportunity. Meteorological data includes barometric pressure, cloud cover, relative
  humidity, sea surface temperature, swell height, air temperature, visibility, wave
  height, wind direction, and wind speed.\",\n\t\"license_title\": null,\n\t\"extras\":
